import React from 'react'
import { Button, Col, Container, Row } from 'react-bootstrap';

type Props = {};
type State = {};

export default class ContactUsSection extends React.Component<Props, State> {

    state = {} as State;

    constructor(props: Props) {
        super(props);
    }

    render(){
        return (
            <section className="contactUsContainer">
                <Container>
                    <Row>
                        <Col md={6}>
                        <a href="https://www.google.com/maps/place/oi+yin+street,+aldrich+bay+road/"/>
                            <img className="map" src="https://maps.googleapis.com/maps/api/staticmap?center=oi+yin+street,+aldrich+bay+road&zoom=16&scale=1&size=600x300&maptype=roadmap&key=AIzaSyCjCVCEaRCewdaqDQE6ocCPC1x_W-EsS-g&format=png&visual_refresh=true&markers=size:mid%7Ccolor:0xff0000%7Clabel:%7Coi+yin+street,+aldrich+bay+road" alt="Google Map of oi yin street, aldrich bay road"/>
                        </Col>
                        <Col md={6}>
                            <h2>Contact Us</h2>
                            Phone: 91234567
                            Address: xxx,Shau Kei Wan
                            <Button variant='primary'>How to get there</Button>
                        </Col>
                    </Row>
                </Container>
            </section>
        )
    }
}
